import React from 'react';
import styled from "styled-components";


const QuoteText = styled("h3")`
font-family: Open Sans;
font-style: normal;
font-weight: normal;
font-size: 28px;
color: #2A2A2A;
padding-top:30px;
`;


const Quote = ({ paragraph }) => {
    return (
        <>
            <QuoteText>{paragraph}</QuoteText>


        </>
    );
}

export default Quote;
